import { Header } from '../Header/header.tsx';
import { Hero } from '../Hero/hero.tsx';
import mainImg from '../../assets/Vector 641.jpg'

export default function App() {
  return (
    <div className="body-page">

      <div className='main shadow-2xl'>        
        <Header />  

        <img src={mainImg} />
        <Hero />   
      </div>

    </div>
  );
}
